import icon_pcdala from "../../icons/icon_pcdala.svg";
import icon_consiliu_judetean from "../../icons/icon_consiliu_judetean.svg";
import icon_primaria from "../../icons/icon_primaria.svg";
import icon_ministerul from "../../icons/icon_ministerul.svg";

export const SponsoriData = [
  {
    icon: <img src={icon_pcdala} alt="" />,
  },
  {
    icon: <img src={icon_consiliu_judetean} alt="" />,
  },
  {
    icon: <img src={icon_primaria} alt="" />,
  },
  {
    icon: <img src={icon_ministerul} alt="" />,
  },
];
